/* 代码映射关系 */
var mapProvince = {}, mapCity = {}, mapRegion = {};
$(function(){
	$.each(allRegionData['p'],function(idx, p){
		var pid = Object.keys(p)[0];
		mapProvince[pid] = p[pid]; 
	});
	
	$.each(allRegionData['c'],function(k,cs){
		$.each(cs,function(idx, c){
			var cid = Object.keys(c)[0];
			mapCity[cid] = c[cid]; 
		});
	});
	
	$.each(allRegionData['r'],function(k,rs){
		$.each(rs,function(idx, r){
			var rid = Object.keys(r)[0];
			mapRegion[rid] = r[rid]; 
		});
	});
});
var show_province_of_dg = function(value, rowData, rowIndex){
	return mapProvince[value];
};
var show_city_of_dg = function(value, rowData, rowIndex){
	return mapCity[value];
};
var show_region_of_dg = function(value, rowData, rowIndex){
	return mapRegion[value];
};
var show_full_location = function (rowData, p, c, r){
    var result = '';
    if ( mapProvince[rowData[p]] ) result =  mapProvince[rowData[p]] ;
    if ( mapCity[rowData[c]] ) result = result + '-' + mapCity[rowData[c]] ;
    if ( mapRegion[rowData[r]] ) result = result + '-' + mapRegion[rowData[r]] ;
    return  result;
};
var show_full_origin_location_of_dg = function(value, rowData, rowIndex){
    return show_full_location(rowData, 'originProvince', 'originCity', 'originRegion');
};
var show_full_dest_location_of_dg = function(value, rowData, rowIndex){
    return show_full_location(rowData, 'destProvince', 'destCity', 'destRegion');
};

//省份选择
var sel_locProvince_data = [{value:'-1',text:'--省市--'}];
$(function(){
	$.each(allRegionData['p'],function(idx, p){
	    var pid = Object.keys(p)[0];
	    sel_locProvince_data.push({value: pid, text: p[pid]});
	});
});

// 地市选择（省市联动）
var get_sel_data_by_pid = function (pid){
	var data = [{value:'-1',text:'--地市--'}];
	if ( allRegionData['c'][pid] !== undefined ) {
    	$.each(allRegionData['c'][pid], function(idx, c){
    		var cid = Object.keys(c)[0];
    	    data.push({value: cid, text: c[cid]});
    	});
	}
	return data;
};
// 区县选择（地市联动）
var get_sel_data_by_cid = function (cid){
    var data = [{value:'-1',text:'--区县--'}];
    if ( allRegionData['r'][cid] !== undefined ) {
        $.each(allRegionData['r'][cid], function(idx, r){
            var rid = Object.keys(r)[0];
            data.push({value: rid, text: r[rid]});
        });
    }
    return data;
};

// 省市区县联动统一代码：
var init_province_city_region = function( cb_pid, cb_cid, cb_rid ){
    $( cb_pid ).combobox({
        data: sel_locProvince_data,
        value: '-1',
        editable: false,
        onSelect: function(p){
            var panelHeightP = 200;
            if (p['value'] == '-1') panelHeightP = 'auto';
            $(cb_cid).combobox({
                data: get_sel_data_by_pid(p['value']),
                value: '-1',
                editable: false,
                panelHeight: panelHeightP,
                onSelect: function(c){
                    var panelHeightC = 200;
                    if (c['value'] == '-1') panelHeightC = 'auto';
                    var data = get_sel_data_by_cid(c['value']); 
                    if (data.length === 1) panelHeightC = 'auto';
                    $(cb_rid).combobox({
                        data: data,
                        value: '-1',
                        editable: false,
                        panelHeight: panelHeightC
                    });
                }
            });
            $(cb_cid).combobox('select','-1');
        }
    });
    
    $(cb_pid).combobox('select','-1');
    
};

        
var get_region_province = function(data){
	var items = new Object();
	if (data.status == 'OK'){
		$.each(data.p,function(index, value){
			$.each( value, function(k, v){
				items[k] = v;
			});
  		});
	}
	return items;
};

var get_region_city = function(data){
	var items = new Object();
	if (data.status == 'OK'){
		$.each(data.c,function(ck, cv){
			$.each(cv,function(index, value){
				$.each(value,function(k,v){
					items[k] = v;
				});				
			});					
  		});
	}
	return items;
};

var get_region_region = function(data){
	var items = new Object();
	if (data.status == 'OK'){
		$.each(data.r,function(rk, rv){
			$.each(rv,function(index, value){
				$.each(value, function(k,v){
					items[k] = v;
				});
			});					
  		});
	}
	return items;
};

var change_region_province = function(e){
	$('#locCity').empty();
	var val = $(this).val();
	if (regionData.status == 'OK'){
		if ($.isArray(regionData.c[val]) ) {
			$.each(regionData.c[val] ,function(index, value){
				$.each(value, function(k,v){
					$('#locCity').append("<option value='"+k+"'>"+v+"</option>");
				});
			});
		} else {
			$('#locCity').append("<option value='0'>&nbsp;&nbsp;&nbsp;</option>");
		}
		
	}
	$('#locCity').trigger("change");
};

var changeSelRegion = function(objThis, objChild, data, key, options, hasChild ) {
	$(objChild).empty();
	$.each(options,function(k,v){
		$(objChild).append("<option value='"+k+"'>"+v+"</option>");
	});
	
	var val = $(objThis).val();
	if (data.status == 'OK'){
		if ($.isArray(data[key][val]) ) {
			$.each(data[key][val] ,function(index, value){
				$.each(value, function(k,v){
					$(objChild).append("<option value='"+k+"' title='"+v+"'>"+v+"</option>");
				});
			});
		}
	}
	if (hasChild) $(objChild).trigger("change");
};

var change_region_city = function(e){
	$('#locRegion').empty();
	var val = $(this).val();
	if (regionData.status == 'OK'){
		if ($.isArray(regionData.r[val]) ) {
			$.each(regionData.r[val] ,function(index, value){
				$.each(value, function(k,v){
					$('#locRegion').append("<option value='"+k+"'>"+v+"</option>");
				});
			});
		}else {
			$('#locRegion').append("<option value='0'>&nbsp;&nbsp;&nbsp;</option>");
		}
	} 
};